import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom'

export const Routes: React.FC = () => {
   return <BrowserRouter>
   <Switch>
     <Route exact path="/" render={() => <div>Hi</div>}></Route>
   </Switch>

   </BrowserRouter>;
}
